/**
 * Kommissionieren
 * 
 */
var k = {


    init() {

        var me = this;

        // Code Reader
        me.codeReader = false;

        // Init Barcode
        me.initBarcode();

        // Positionen
        me.positions = {
            1: {
                artikel_id: 100000,
                menge: 1,
                kommission: 0
            },
            2: {
                artikel_id: 100001,
                menge: 1,
                kommission: 0
            },
            3: {
                artikel_id: 100002,
                menge: 2,
                kommission: 0
            }
        };

        me.temp = me.positions;

        me.renderPositionen();

        me.addListner();

    },

    initBarcode() {

        var me = this;

        // Is Active auf False stellen
        me.isActive = false;

        // 
        $('#tab-nav-uebersicht-video').html('<i class="fa-solid fa-circle-notch fa-spin"></i> Barcode');
        $('#video-content').hide();
        $('#video-info').show().html('<i class="fa-solid fa-circle-notch fa-spin"></i> <i class="fa-solid fa-video"></i> Kamera wird initalisiert!');

        // Barcode initalisieren
        try {

            // Reader Engine starten
            me.codeReader = new ZXing.BrowserMultiFormatReader();

            // Wenn es nicht klappt
        } catch (ex) {
            // Exception
        }

        // Wenn der Code Reader vorhanden ist
        if (me.codeReader) {

            // Probieren die Devices zu erhalten
            me.codeReader.listVideoInputDevices().then((videoInputDevices) => {

                // Video Devices
                me.codeDevices = videoInputDevices;

                // Weiter
                me.cameraSuccess();

            }).catch((err) => {
                me.cameraError();
            })

            // Wenn es einen Fehler gibt
        } else {
            me.cameraError();
        }
    },

    addListner() {


        var me = this;

        $('#auftrag-abschliessen').on('click', function() {
            app.alert.success.fire("Auftrag abgeschlossen","Der Auftrag wurde vollständig kommissioniert. Es wird der nächste Auftrag geladen").then(function() {
                me.positions = me.temp;
                me.renderPositionen();
            });      

        });
    },

    cameraSuccess: function () {

        var me = this;

        // 
        $('#tab-nav-uebersicht-video').html('<i class="fa-solid fa-video"></i> Barcode');
        $('#video-info').show().html('<i class="fa-solid fa-video"></i> Kamera ist Einsatzbereit. Starten Sie die Verarbeitung!');

        // Event Listner hinzufügens
        $('.btn-toggle-scan').on('click', function () {
            me.cameraStart();
        });

    },

    // Kamera Fehler
    cameraError: function (error) {
        $('#tab-nav-uebersicht-video').html('<i class="fa-solid fa-exclamation-triangle text-danger"></i> Barcode');
        $('#video-content').hide();
        $('#video-info').show().html('<i class="fa-solid fa-video"></i> Es ist ein Fehler mit der Kamera aufgetreten!');
    },

    // Kamera
    cameraSelect(callback) {

        var me = this;

        // TODO: Hier kann noch ein Dialog oder Standard einstellungen oder ähnliches kommen
        var device = me.codeDevices[0].deviceId;

        callback(device);
    },

    // Starten
    cameraStart() {

        var me = this;

        // 
        me.cameraSelect(function (deviceId) {

            // Video
            $('#video-info').hide();
            $('#video-content').show();

            // Fokus auf das Tab
            var tab = new bootstrap.Tab($('#tab-nav-uebersicht-video').get(0));
            tab.show();

            // Video dekodieren
            me.codeReader.decodeFromVideoDevice(deviceId, 'video-content', (result, err) => {

                // Wenn es ein Ergebnis gibt
                if (result) {
                    me.scanned(result);
                }

                // Wenn es einen Fehler gibt??
                if (err && !(err instanceof ZXing.NotFoundException)) {
                    console.error(err)
                }
            });

        });
    },

    // 
    renderPositionen() {

        var me = this;

        var cols = [];

        var complete = true;

        // Positionen
        $.each(me.positions, function (index, value) {


            // Icon
            var icon = (value.kommission == value.menge) ? '<i class="fa fa-check text-success"></i>' : '<i class="fa fa-times text-danger"></i>';

            cols.push('<th>' + index + '</th><td>' + value.artikel_id + '</td><td>' + value.kommission + ' / ' + value.menge + '</td><td>' + icon + '</td>');

            if(value.kommission != value.menge) {
                complete = false;
            }

        });

        // Positionstabelle
        $('#position-table').html('<tr>' + cols.join('</tr><tr>') + '</tr>');

        // Wenn alle vollständig sind!
        if(complete) {
            $('#auftrag-abschliessen').prop('disabled',false);
        }

    },

    // 
    scanned(scanResult) {

        console.log('>>> Scan Result >' + scanResult.text + '<');

        var me = this;

        if(!me.isActive) {

            me.isActive = true;

            // Ergebnisse
            var results = {
                open: [],
                closed: []
            };

            // Alle Positionen durchsuchen
            $.each(me.positions, function (index, value) {

                

                // Prüfen ob die Artikel Id gefunden wurde?
                if (value.artikel_id == scanResult.text) {

                    // Wenn noch eine Liefermenge für das Kommissionieren da ist
                    if (value.kommission < value.menge) {
                        results.open.push(index);

                        // Wenn beriets aufgebraucht wurde
                    } else {
                        results.closed.push(index);
                    }
                }
            });

            // Wenn es Ergebnisse gibt
            if (results.open.length > 0) {

                // Von oben nach unten die Liste abarbeiten
                var index = results.open[0];

                // Neu Buchen!
                me.positions[index].kommission++;

                // Beep
                me.beep();

                // Timeout um doppel-Scans zu verhindern
                me.reactivate();

                // Wenn es keine offenen gibt
            } else {

                me.beep(true);
                
                if (results.closed.length > 0) {
                    app.alert.error.fire("Artikel bereits vollständig!", "Der gescannte Artikel wurde bereits in der gewünscht Menge kommissioniert! Bitte prüfen Sie Ihre Eingaben!").then(function () {
                        me.reactivate();
                    });
                } else {
                    app.alert.error.fire("Artikel nicht vorhanden!", "Der gescannte Artikel ist nicht in diesem Auftrag enthalten. Bitte prüfen Sie Ihre Eingaben!").then(function () {
                        me.reactivate();                
                    });
                }
            }

            // Positionen neu Rendenr
            me.renderPositionen();

        }
    },

    reactivate() {

        var me = this;

        // Mindestens eine Sekunden warten, damit man Zeit hat, das HAndy wegzulegen
        setTimeout(function () {
            me.isActive = false;
        }, 1000);
    },


    beep(isError) {    

        isError = isError || false;

        var error = new Audio("data:audio/wav;base64,");


        var error = new Audio("data:audio/wav;base64,");


        var success = new Audio("data:audio/wav;base64,");
        
        if(isError) {
            error.play();
        } else {
            success.play();
        }
        
    }


}